BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `User` (
	`IDuser`	TEXT NOT NULL UNIQUE,
	`Password`	TEXT NOT NULL,
	`Active`	INTEGER NOT NULL,
	`Name`	TEXT NOT NULL,
	`LastName`	TEXT NOT NULL,
	`Username`	TEXT NOT NULL UNIQUE,
	`Email`	TEXT NOT NULL,
	PRIMARY KEY(`IDuser`)
);
CREATE TABLE IF NOT EXISTS `Telephone` (
	`IDuser`	TEXT NOT NULL,
	`Number`	TEXT NOT NULL,
	PRIMARY KEY(`IDuser`,`Number`),
	FOREIGN KEY(`IDuser`) REFERENCES `Doctor`(`IDuser`)
);
CREATE TABLE IF NOT EXISTS `Patient` (
	`IDptt`	TEXT NOT NULL UNIQUE,
	`Name`	TEXT NOT NULL,
	`LastName`	TEXT NOT NULL,
	`Municipality`	TEXT NOT NULL,
	`Address`	TEXT NOT NULL,
	`Sex`	TEXT NOT NULL,
	`Status`	TEXT NOT NULL,
	`SSN`	TEXT NOT NULL,
	`Doctor`	TEXT NOT NULL,
	FOREIGN KEY(`Doctor`) REFERENCES `Doctor`(`IDuser`),
	PRIMARY KEY(`IDptt`)
);
CREATE TABLE IF NOT EXISTS `Message` (
	`IDmsg`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,
	`IDuser`	TEXT NOT NULL,
	`IDptt`	TEXT NOT NULL,
	`Data`	TEXT NOT NULL,
	`Date`	TEXT NOT NULL,
	`Seen`	INTEGER NOT NULL,
	FOREIGN KEY(`IDptt`) REFERENCES `Patient`(`IDptt`),
	FOREIGN KEY(`IDuser`) REFERENCES `CLINICAL`(`IDuser`)
);
