CREATE TABLE IF NOT EXISTS `ECG` (
	`IDecg`	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,
	`IDuser`	TEXT NOT NULL,
	`IDptt`	TEXT NOT NULL,
	`Frequency`	INTEGER NOT NULL,
	`Data`	BLOB NOT NULL,
	`Date`	TEXT NOT NULL,
	`Seen`	TEXT NOT NULL,
	`Diagnostic`	TEXT,
	FOREIGN KEY(`IDptt`) REFERENCES `Patient`(`IDptt`),
	FOREIGN KEY(`IDuser`) REFERENCES `Assistant`(`IDuser`)
);
CREATE TABLE IF NOT EXISTS `Doctor` (
	`IDuser`	TEXT NOT NULL,
	`MLN`	INTEGER NOT NULL,
	FOREIGN KEY(`IDuser`) REFERENCES `User`(`IDuser`),
	PRIMARY KEY(`IDuser`)
);
CREATE TABLE IF NOT EXISTS `CLINICAL` (
	`IDuser`	TEXT NOT NULL,
	`SSN`	INTEGER NOT NULL,
	FOREIGN KEY(`IDuser`) REFERENCES `User`(`IDuser`),
	PRIMARY KEY(`IDuser`)
);
CREATE TABLE IF NOT EXISTS `Assistant` (
	`IDuser`	TEXT NOT NULL,
	`Municipality`	TEXT NOT NULL,
	FOREIGN KEY(`IDuser`) REFERENCES `User`(`IDuser`),
	PRIMARY KEY(`IDuser`)
);
CREATE TABLE IF NOT EXISTS `ADMIN` (
	`IDuser`	TEXT NOT NULL,
	FOREIGN KEY(`IDuser`) REFERENCES `User`(`IDuser`),
	PRIMARY KEY(`IDuser`)
);
COMMIT;
